import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCode, faComment } from "@fortawesome/free-solid-svg-icons";

const Boxes = () => {
  return (
    <nav className="box">
      <a className="box-1" href="#section-3-project">
        <h2 className="box-title"> Frontend developer</h2>
        <FontAwesomeIcon icon={faCode} size="1x" />
      </a>

      <a className="box-2 box-title">My entrepre neurship</a>
      <a className="box-3 box-title">Know me better</a>
      <a className="box-4 box-title">
        Let's get in touch
        <FontAwesomeIcon className="fa-boxes" icon={faComment} />
      </a>
    </nav>
  );
};

export default Boxes;
